    MWF77_l3dpartdirect(in0_, in1_, in2_, in3_, in4_, in5_, in6_, in7_, in8_, in9_, in10_, in11_, in12_, in13_, in14_, in15_, in16_);
    plhs[0] = mxCreateDoubleMatrix(mxGetM(prhs[8]), mxGetN(prhs[8]), mxCOMPLEX);
    mxWrapCopy_dcomplex(plhs[0], in8_, mxGetM(prhs[8])*mxGetN(prhs[8]));
    plhs[1] = mxCreateDoubleMatrix(mxGetM(prhs[10]), mxGetN(prhs[10]), mxCOMPLEX);
    mxWrapCopy_dcomplex(plhs[1], in10_, mxGetM(prhs[10])*mxGetN(prhs[10]));
    plhs[2] = mxCreateDoubleMatrix(mxGetM(prhs[14]), mxGetN(prhs[14]), mxCOMPLEX);
