/* ----
 */
void mexFunction(int nlhs, mxArray* plhs[],
                 int nrhs, const mxArray* prhs[])
{
    char id[512];
    if (nrhs == 0) {
        mexPrintf("Mex function installed\n");
        return;
    }

    if (mxGetString(prhs[0], id, sizeof(id)) != 0)
        mexErrMsgTxt("Identifier should be a string");
    else if (strcmp(id, stubids1_) == 0)
        mexStub1(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, stubids2_) == 0)
        mexStub2(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, stubids3_) == 0)
        mexStub3(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, stubids4_) == 0)
        mexStub4(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, stubids5_) == 0)
        mexStub5(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, stubids6_) == 0)
        mexStub6(nlhs,plhs, nrhs-1,prhs+1);
    else if (strcmp(id, "*profile on*") == 0) {
        if (!mexprofrecord_) {
            mexprofrecord_ = (int*) malloc(7 * sizeof(int));
            mexLock();
        }
        memset(mexprofrecord_, 0, 7 * sizeof(int));
    } else if (strcmp(id, "*profile off*") == 0) {
        if (mexprofrecord_) {
            free(mexprofrecord_);
            mexUnlock();
        }
        mexprofrecord_ = NULL;
    } else if (strcmp(id, "*profile report*") == 0) {
        if (!mexprofrecord_)
            mexPrintf("Profiler inactive\n");
        mexPrintf("%d calls to fmm3d_legacy.mw:121\n", mexprofrecord_[1]);
        mexPrintf("%d calls to fmm3d_legacy.mw:123\n", mexprofrecord_[2]);
        mexPrintf("%d calls to fmm3d_legacy.mw:241\n", mexprofrecord_[3]);
        mexPrintf("%d calls to fmm3d_legacy.mw:372\n", mexprofrecord_[4]);
        mexPrintf("%d calls to fmm3d_legacy.mw:374\n", mexprofrecord_[5]);
        mexPrintf("%d calls to fmm3d_legacy.mw:490\n", mexprofrecord_[6]);
    } else if (strcmp(id, "*profile log*") == 0) {
        FILE* logfp;
        if (nrhs != 2 || mxGetString(prhs[1], id, sizeof(id)) != 0)
            mexErrMsgTxt("Must have two string arguments");
        logfp = fopen(id, "w+");
        if (!logfp)
            mexErrMsgTxt("Cannot open log for output");
        if (!mexprofrecord_)
            fprintf(logfp, "Profiler inactive\n");
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:121\n", mexprofrecord_[1]);
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:123\n", mexprofrecord_[2]);
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:241\n", mexprofrecord_[3]);
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:372\n", mexprofrecord_[4]);
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:374\n", mexprofrecord_[5]);
        fprintf(logfp, "%d calls to fmm3d_legacy.mw:490\n", mexprofrecord_[6]);
        fclose(logfp);
    } else
        mexErrMsgTxt("Unknown identifier");
}

